function getHeader(h, name){
  const k = Object.keys(h || {}).find(x => x.toLowerCase() === name.toLowerCase());
  return k ? String(h[k] ?? '') : '';
}

function hmacHex(secret, s){
  return require('crypto')
    .createHmac('sha256', String(secret))
    .update(Buffer.from(String(s), 'utf8'))
    .digest('hex');
}

function pickBinary(inItem){
  const bin = inItem.binary || {};
  const keys = Object.keys(bin);
  if (!keys.length) return { has:false, keys:[], chosen: undefined, bytes:0, firstHex:null };

  const prefer = ['file', 'file0', 'data', ...keys];
  for (const k of prefer){
    if (!bin[k]) continue;
    let bytes = 0, firstHex = null;
    const b64 = bin[k].data;
    if (typeof b64 === 'string' && b64.length){
      try{
        const buf = Buffer.from(b64, 'base64');
        bytes = buf.length;
        firstHex = buf.subarray(0,16).toString('hex');
      }catch(e){}
    }
    return { has:true, keys, chosen:k, bytes, firstHex };
  }
  return { has:false, keys, chosen: undefined, bytes:0, firstHex:null };
}

