// Outputs guaranteed: strict_mode:boolean, strategy:object, overrides:object
// NOW ALSO READS FROM HTTP HEADERS (x-strict-mode, x-strategy-json, x-overrides-json)

function coerceBool(v) {
  if (typeof v === 'boolean') return v;
  if (v === null || v === undefined) return undefined;
  const s = String(v).trim().toLowerCase();
  if (s === 'true') return true;
  if (s === 'false') return false;
  return undefined;
}

function tryJson(str) {
  try { return JSON.parse(str); } catch { return undefined; }
}

function stripFence(s) {
  const re = /```(?:json)?\s*([\s\S]*?)```/i;
  const m = re.exec(s);
  return m ? m[1] : s;
}

function stripBOM(s) {
  return s.replace(/^\uFEFF/, '');
}

function safeParse(input) {
  if (!input) return undefined;
  if (typeof input === 'object') return input;

  let s = String(input);
  s = stripBOM(s).trim();
  if (!s) return undefined;

  let parsed = tryJson(s);
  if (parsed !== undefined) return parsed;

  const de = stripFence(s).trim();
  if (de && de !== s) {
    parsed = tryJson(de);
    if (parsed !== undefined) return parsed;
  }

  const sq = de || s;
  if (/['"]/g.test(sq)) {
    const swapped = sq.replace(/'/g, '"');
    parsed = tryJson(swapped);
    if (parsed !== undefined) return parsed;
  }

  return undefined;
}

function isObj(o) {
  return o && typeof o === 'object' && !Array.isArray(o);
}

function sanitizePerProduct(pp) {
  if (!isObj(pp)) return undefined;
  const out = {};
  for (const [handle, cfg] of Object.entries(pp)) {
    if (!isObj(cfg)) continue;
    const chosen = Array.isArray(cfg.chosen_options) ? cfg.chosen_options.filter(Boolean).slice(0, 3) : undefined;
    const overflow_to = typeof cfg.overflow_to === 'string' ? cfg.overflow_to : undefined;
    const clean = {};
    if (chosen && chosen.length) clean.chosen_options = chosen;
    if (overflow_to) clean.overflow_to = overflow_to;
    if (Object.keys(clean).length) out[handle] = clean;
  }
  return Object.keys(out).length ? out : undefined;
}

